class Solution {
    public long continuousSubarrays(int[] nums) {
        long count = 0;
        int left = 0, right;
        for (right = 0; right < nums.length; right++) {
            int max = nums[right], min = nums[right];
            for (int k = right; k >= left; k--) {
                max = Math.max(max, nums[k]);
                min = Math.min(min, nums[k]);
                if (max - min <= 2) {
                    count++;
                } else {
                    left = k + 1;
                    break;
                }
            }
        }
        return count;
    }
}
